import React from "react";
import {Checkbox } from "../form/inputs";
import Image from "./image";
import {PhoneInput} from "../form/input-fields/phone-input";
import {ContentWrapper, FlexContainer, CustomButton, CheckBoxContainer, ContentContainer, HeaderContainer, CenteredForm, FormContainer, Avatar, NavLink, Title, SubTitle} from "./elements";

const PhoneVerification = () => {
  return (
    <>
      <ContentWrapper>
        <Image />
        <FormContainer>
          <CenteredForm>
            <HeaderContainer>
            <Title>Verify your Phone Number</Title>
            <SubTitle>Verify your number by typing the 6 digit code we sent via text.</SubTitle>
            </HeaderContainer>
            <ContentContainer>
            <PhoneInput
              label="Phone Number *"
              placeholder="your phone number"
              id="phone"/>

            <CustomButton>Continue</CustomButton>
            <FlexContainer>
              <SubTitle>Problem receiving the code?</SubTitle>
              <FlexContainer>
                <Avatar src={require("../../assets/icons/main-search.svg")} />
                <NavLink href="/">Support Center</NavLink>
              </FlexContainer>
            </FlexContainer>
            </ContentContainer>
          </CenteredForm>
        </FormContainer>
      </ContentWrapper>
    </>
  );
};

export default PhoneVerification;
